import React from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';

const Cart = () => {
  return (
    <CartDiv>
      <Link to="/cart">
        <img src="./static/cart.png" alt="cart" width="50px" height="50px" />
      </Link>
    </CartDiv>
  );
};

const CartDiv = styled.div`
  float: left;
`;

export default Cart;
